w compatible with Magento Enterprise edition.','Firecheckout is now compatible with Magento Enterprise edition.','http://bit.ly/JQqvRi ',1,0),(100,4,'2012-05-24 19:39:46','Prolabels 2.0 with unlimited labels support now available!','Prolabels 2.0 is now available with great new features:\n\n- Unlimited number of labels\n- Flexible condition rules\n- Optimized for large catalogs','http://bit.ly/MKP9ou ',1,0),(101,4,'2012-05-25 14:40:31','Helpmate with great new features and Magento CE 1.7 support is now available',' Helpmate 1.2 is now available with great new features:\n\n- Private tickets responses not visible to users.\n- Create ticket buttons on order and customer admin pages\n- Multiply select option for storeviews on kb articles page\n- Categories and Articles sort order in KB\n- Improve search and suggest algorithm of KB articles\n- Ajax Search compatibility ','http://bit.ly/LhSTwf ',1,0),(102,4,'2012-05-30 16:07:16','Magento templates are now compatible with Magento CE 1.7','We are glad to inform that all our templates were recently updated to Magento CE 1.7. Request your update at http://bit.ly/q51qxj ','http://bit.ly/KHFrQY',1,0),(103,4,'2012-06-22 14:22:54','Prolabels 2.1 is now available','Prolabels 2.1 is now available with next new features and bugfixes:\n\n- Performance update\n- Active products grid interface added for labels\n- Out of stock label text option added\n- Catalog indexes conflict fixed','http://bit.ly/LGESFz',1,0),(104,4,'2012-07-05 14:12:33','Firecheckout 2.2 is now available.','Fire Checkout 2.2 is now available with great new features:\n\n- 5 custom order fields added\n- Hide other shipping methods, if free is applicable (optional)\n- Nice looking styles on our Mobile Star theme\n- Improved positioning of the popup window and spinner on mobile devices\n- Fixed conflict with Magento\'s _canShowForUnregisteredUsers method.\n- In order to improve Fire Checkout compatibility with third party extensions \"Enable Agreements\" option was removed. Please use Magento standard config option instead. You can find it at the checkout options section.','http://bit.ly/N8Cyqi',1,0),(105,4,'2012-07-25 14:07:32','Prolabels 2.2 is now available','Prolabels 2.2 is now available with next new features\n\n- Unlimited number of system labels\n- Improved localization for system labels\n','http://bit.ly/Qj65pj',1,0),(106,4,'2012-08-01 15:26:13','Ajax Layered Navigation 1.1 is now available','Ajax Layered Navigation 1.1 is now available with next new features\n\n- Two new layered navigation styles: vertical layered navigation and drop down layered navigation\n- Limit number of filters to show\n- Improved Magento 1.7 compatibility\n- Improved price ranges algorithm\n','http://bit.ly/ODpjUN',1,0),(107,4,'2012-08-09 14:31:48','Ajax Pro 2.0  is now available','Ajax Pro 2.0  is now available with next new features\n\n- completely refactored extension logic for better performance and better compatibility\n- javascript login form added','http://bit.ly/Na3k8u',1,0),(108,4,'2012-08-17 15:17:07','Social Suite 1.2 with Pinterest integration is now available','Social Suite 1.2  is now available with next new features\n\n- Pinterest integration\n','http://bit.ly/N8Mcu0',1,0),(109,4,'2012-08-27 14:15:31','Ajax Pro 2.0.1 update is now available','Ajax Pro 2.0.1  is now available with next new features\n\n- Ajax Pro links and actions disabled for search engines spiders\n','http://bit.ly/PVixZE',1,0),(110,4,'2012-08-30 19:16:37','Helpmate 1.2.1 is now available','Helpmate 1.2.1  is now available with next new features\n\n- Captcha support for Magento 1.7\n- Frontend layout field label alignment fixed\n- File uploaded type javascript validation added\n- Order info field is now optional\n- Improved admin tickets message format\n\n','http://bit.ly/UdSddX',1,0),(111,4,'2012-11-19 20:27:42','Wrap up more holiday sales with financing','Give your customers up to 6 months financing. You get paid right away with Bill Me Later, a PayPal service. It’s a great way to extend financing in time for the holidays. Learn More.','http://www.magentocommerce.com/paypal/billmelater?utm_source=CEMessaging&utm_medium=copy&utm_content=sixmonths&utm_campaign=BML',0,0),(112,4,'2013-01-15 22:02:07','Imagine 2013 Registration is Now Open!','Join 1500 merchants, partners, developers and enthusiasts from 35+ countries around the world for Magento’s premier global conference! Collaborate, learn, network and get inspired by the future of eCommerce. Tickets will sell out fast! April 8th – 10th in Las Vegas.','https://registration.imagineecommerce.com/',0,0),(113,4,'2013-02-12 17:53:42','Get More eCommerce Power with Magento Enterprise','Limited time offer: Get a free, customized evaluation of your Community Edition site from a Magento Solution Partner. This evaluation gives you a clear look at the numerous benefits you can achieve by upgrading to Enterprise Edition. ','http://www.magentocommerce.com/community-to-enterprise?utm_source=CEMM&utm_medium=copy&utm_campaign=CE2EE',0,0),(114,2,'2013-09-27 17:28:13','Magento Community Edition 1.8.0.0 - now available for download!','Get tax, security, performance, and many other improvements. \n\nLearn more at http://www.magentocommerce.com/blog/comments/magento-community-edition-one-eight-now-available/ ','http://www.magentocommerce.com/blog/comments/magento-community-edition-one-eight-now-available/',0,0),(115,4,'2013-12-11 15:35:06','Magento Community Edition 1.8.1.0 is here!','This new version offers significant tax calculation, product quality, and security enhancements. Be sure to carefully review the upgrade instructions before starting. More information is available at http://www.magentocommerce.com/blog/comments/magento-community-edition-1810-is-here/','http://www.magentocommerce.com/blog/comments/magento-community-edition-1810-is-here/',0,0),(116,4,'2013-12-12 23:24:39','Important Magento Community Edition Patch','A security patch is available for Magento Community Edition 1.4.0.0 through 1.7.0.2; the issue has been fixed in Magento Community Edition 1.8.0.0 and later. It resolves a vulnerability discovered through our quarterly penetration testing process and has not been reported by merchants. We encourage all merchants to apply the patch in their next regularly scheduled maintenance cycle. The patch is available at http://www.magentocommerce.com/download in the Magento Community Edition Patches section.','http://www.magentocommerce.com/download',0,0),(117,4,'2014-01-21 18:34:48','PHP 5.4 Patch Now Available','Magento is advancing its platform and making development more efficient by adding support for PHP 5.4. Patches are available for download at www.magentocommerce.com/download and you can learn more about this update in our blog post at http://www.magentocommerce.com/blog/comments/magento-now-supports-php-54 .','http://www.magentocommerce.com/blog/comments/magento-now-supports-php-54',0,0),(118,4,'2014-02-20 17:51:46','Discover Card Validation Patch Available','A patch that resolves an issue with validating Discover credit cards is now available for download at http://www.magentocommerce.com/download. More information on the patch is available in the Magento Knowledge Base at http://www.magentocommerce.com/knowledge-base/entry/discover-card-validation','http://www.magentocommerce.com/knowledge-base/entry/discover-card-validation ',0,0),(119,4,'2014-03-04 15:12:26','Learn How to Quickly Increase Sales on Your Site','Adding the PayPal Express Checkout button to your checkout page can help increase sales 18% on average. It’s fast and easy and you can do it right now to boost sales. Express Checkout is already seamlessly integrated into Community Edition.','http://magento.com/paypal/CE_Express_Checkout_NA?utm_source=messagemodule&utm_medium=message&utm_campaign=Ceexpresscheckout',0,0),(120,4,'2014-05-13 16:46:11','Magento Community Edition 1.9 is now available!','It accelerates your entry into the mobile commerce space by slashing the time and cost of getting a mobile device-friendly responsive site.  And a new Bill Me Later payment option helps boost your sales. Visit http://magento.com/blog/magento-news/magento-enables-responsive-sites-half-time to learn more.','http://magento.com/blog/magento-news/magento-enables-responsive-sites-half-time',0,0),(121,4,'2014-10-08 04:55:06','It’s still not too late: Boost your 2014 Holiday sales today.','See results in as little as one week with eBay Enterprise Display and 2 business days with eBay Enterprise Affiliate. DID YOU KNOW: Get access to over 128 million highly qualified shoppers on eBay.com with eBay Enterprise Display. And the average retail client using product retargeting sees a $10 to $1 ROI on retargeting spend during Q4. With the eBay Enterprise Affiliate Network, get access to over 200,000 active network publishers across 30+ verticals, and only pay when a customer makes a purchase (Affiliate Network is only available in the U.S. & Canada).  GET STARTED TODAY by visiting www.ebayenterprise.com/turbochargesales','http://www.ebayenterprise.com/turbochargesales',0,0),(122,4,'2014-11-12 19:03:26','Important: PayPal Users Must Discontinue Using SSL 3.0 By December 3, 2014','To address a vulnerability with the SSL 3.0 security protocol, PayPal and other payment gateways will be disabling SSL 3.0 support. Merchants must upgrade to Transport Layer Service (TLS) by December 3, 2014 to avoid PayPal payment operation failures. Learn more about what you need to do at https://devblog.paypal.com/poodle-ssl-3-0-vulnerability/','https://devblog.paypal.com/poodle-ssl-3-0-vulnerability/',0,0),(123,4,'2014-11-24 23:25:21','Magento Community Edition 1.9.1 is available!','Magento Community Edition 1.9.1 empowers merchants to deliver compelling shopping experiences by offering enhanced responsive design capabilities, new swatches to display product variations, and improved performance through support for MySQL 5.6 and PHP 5.5. It also includes support for Google Universal Analytics and over 70 product improvements. Find out more at http://magento.com/blog/magento-news/magento-community-edition-191-now-available-download','http://magento.com/blog/magento-news/magento-community-edition-191-now-available-download',0,0),(124,4,'2015-01-22 17:47:08','Join Us at Imagine Commerce 2015 - April 20-22 at the Wynn Las Vegas','Join Magento, eBay Enterprise, and over 2,000 merchants, developers, and eCommerce experts at the premier Commerce event of the year. With three days of cutting-edge keynote presentations, special technical programs, dynamic breakout sessions, and incredible networking opportunities, Imagine Commerce 2015 will educate, enrich, and inspire you to take your business to new heights. Register now at http://imagine2015.magento.com/.','http://imagine2015.magento.com/',0,0),(125,2,'2017-06-13 18:20:53','New Patch for PayPal Instant Payment Notification (IPN) Changes. Upgrade to 1.9.3.3 or SUPEE-8167 by June 30, 2017 to Avoid Service Disruptions – 6/13/2017','As of June 30, 2017, PayPal Instant Payment Notifications will no longer allow you to use HTTP to post messages back to PayPal for verification. To comply with these changes, all merchants using PayPal must upgrade to Community Edition 1.9.3.3 or apply the SUPEE-8167 patch. Updates must be in place by June 30, 2017 to avoid any service disruptions. The patch is available on the Community Edition Download Page (https://magento.com/tech-resources/download) and more information is available from PayPal at https://www.paypal-knowledge.com/infocenter/index?page=content&widgetview=true&id=FAQ1916&viewlocale=en_US\n\n','https://magento.com/tech-resources/download ',0,0),(126,2,'2017-09-11 22:52:53','USPS Name Change Impacts “First-Class Mail Parcel” Service – 09/11/2017','USPS changed their “First-Class Mail Parcel” Service to “First-Class Package Service – Retail.” Merchants offering this service must change the name, as “First-Class Mail Parcel” will no longer work. Patches addressing this issue are available on the Magento Open Source download page. More information about the issue is available in a Technical Bulletin at http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html ','http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html ',0,0),(127,1,'2017-09-15 17:50:16','Magento Open Source 1.9.3.6 and SUPEE-10266 Security Enhancements – 9/14/2017','Magento Open Source 1.9.3.6 and SUPEE-10266 include critical security enhancements. Please update your site as soon as possible. More information is available in the release notes: \nhttp://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html.\n','http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html',0,0),(128,4,'2017-09-26 22:42:02','Magento Open Source 2.2 Delivers Enhanced Commerce Capabilities – 9/26/2017','Magento Open Source 2.2 includes a range of platform enhancements, including a new deployment process that minimizes production downtime, optimized performance, platform updates that improve developer experience, and Magento Social marketing tools. Learn more at http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html.\n\n','http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html ',0,0);
