INSERT INTO `aw_blog` VALUES (1,'Excepteur sint occaecat','<img style=\"float: left;  margin-right: 20px;\" src=\"{{media url=\"wysiwyg/blog_img/small_2.jpg\"}}\" alt=\"\" />\r\n<p>This stage can get a little confusing but I hope to simplify as much as possible. The Headroom plugin requires a large amount of CSS, but unfortunately this isn&rsquo;t clarified on the plugin&rsquo;s homepage. My demo CSS file is split into different code sections and towards the bottom you&rsquo;ll find a whole bunch of animations and keyframes using CSS3 properties. In order to get your page working you should copy this CSS into your own stylesheet. Various classes pertain to different animations where the header bar will slide up out of view or slide down into view.</p>\r\n\r\n<p> My demo CSS file is split into different code sections and towards the bottom you&rsquo;ll find a whole bunch of animations and keyframes using CSS3 properties. In order to get your page working you should copy this CSS into your own stylesheet. Various classes pertain to different animations where the header bar will slide up out of view or slide down into view This stage can get a little confusing but I hope to simplify as much as possible. The Headroom plugin requires a large amount of CSS, but unfortunately this isn&rsquo;t clarified on the plugin&rsquo;s homepage. My demo CSS file is split into different code sections and towards the bottom you&rsquo;ll find a whole bunch of animations and keyframes using CSS3 properties. In order to get your page working you should copy this CSS into your own stylesheet. Various classes pertain to different animations where the header bar will slide up out of view or slide down into view.</p>',1,'2010-09-06 07:28:34','2015-02-12 15:30:18','Excepteur','Joe Blogs','admin admins','Keywords','Description',0,'','<img style=\"float: left; margin-right: 20px;\" src=\"{{media url=\"wysiwyg/blog_img/small_2.jpg\"}}\" alt=\"\" /><p>This stage can get a little confusing but I hope to simplify as much as possible. The Headroom plugin requires a large amount of CSS, but unfortunately this isn&rsquo;t clarified on the plugin&rsquo;s homepage.</p>'),(2,'Headroom JS Method','<img style=\"float: left;  margin-right: 20px;\" src=\"{{media url=\"wysiwyg/blog_img/small_4.jpg\"}}\" alt=\"\" />  <p>Moving back into the HTML file open a new script tag at the very bottom before closing the body section. We need to use a large block of JS to initialize the Headroom plugin class while passing some optional parameters.\r\n\r\nThe header variable targets the initial #header ID and stores this element to pass into the Headroom method. This element is all we actually need to initiate the plugin, but some optional parameters allow you to customize the effect.\r\n\r\nThe first option tolerance is one of two object literals in this set. Basically it takes a list of key/value pairs and passes them into the function or method. The numeric values represent scrolled pixels before the header should re-appear or disappear. So for example once the header slides out of view the user needs to scroll 5px up before it slides back into view.</p>',1,'2015-02-12 15:43:48',NULL,'JS_Method','admin admins','admin admins','','',0,'','<img style=\"float: left;  margin-right: 20px;\" src=\"{{media url=\"wysiwyg/blog_img/small_4.jpg\"}}\" alt=\"\" />Moving back into the HTML file open a new script tag at the very bottom before closing the body section. We need to use a large block of JS to initialize the Headroom plugin class while passing some optional parameters.'),(3,'Business Muse Template','<img style=\"float: left;  margin-right: 20px;\" src=\"{{media url=\"wysiwyg/blog_img/small_3.jpg\"}}\" alt=\"\" /><p>Praising those system born resultant give physical trivial resultant who it toil consequences it one not trivial occasionally one that procure idea will. Builder truth painful advantage enjoy, obtain procure ever advantage obtain happiness, resultant obtain right explain &mdash; it enjoy because but itself was denouncing the. Consequences was all: procure, builder chooses account pursue again idea was man or rationally, you pursue and encounter circumstances desires you happiness human desires. In, truth, occur pursues exercise of us pleasure, again toil itself &mdash; not the explain rejects not nor. Who with truth itself again, must how trivial extremely because anyone example undertakes system idea how no those painful but anyone system human of.</p>\r\n\r\n<p>Builder truth painful advantage enjoy, obtain procure ever advantage obtain happiness, resultant obtain right explain &mdash; it enjoy because but itself was denouncing the. Consequences was all: procure, builder chooses account pursue again idea was man or rationally, you pursue and encounter circumstances desires you happiness human desires. In, truth, occur pursues exercise of us pleasure, again toil itself &mdash; not the explain rejects not nor. Who with truth itself again, must how trivial extremely because anyone example undertakes system idea how no those painful but anyone system human of.</p>',1,'2015-02-12 15:44:32',NULL,'Business','admin admins','admin admins','','',0,'','<img style=\"float: left;  margin-right: 20px;\" src=\"{{media url=\"wysiwyg/blog_img/small_3.jpg\"}}\" alt=\"\" />\r\n<p>This business template is suited for a corporate, advertising, media, design, hosting, it company, agency, studio etc. but it can easily be used for a personal page or a portfolio.</p>'),(4,'Getting Started','<img style=\"float: left;  margin-right: 20px;\" src=\"{{media url=\"wysiwyg/blog_img/small_2.jpg\"}}\" alt=\"\" />First we need a local copy of the Headroom.js script which you can download from the plugin website or from the Github repo. I’m using the minified version but they both contain the same exact code. Now the initial setup requires a fixed header bar which stays on top of the page using basic CSS properties.\r\nThen within the page body I have two primary sections. The first is a large navigation bar with an internal wrapper for the content. The page content s broken into another div using the same wrapper class. This allows everything to be responsive and resize based on the browser width.\r\n.\r\nThen within the page body I have two primary sections. The first is a large navigation bar with an internal wrapper for the content. The page content s broken into another div using the same wrapper class. This allows everything to be responsive and resize based on the browser width.\r\n\r\nFirst we need a local copy of the Headroom.js script which you can download from the plugin website or from the Github repo. I’m using the minified version but they both contain the same exact code. Now the initial setup requires a fixed header bar which stays on top of the page using basic CSS properties',1,'2015-02-12 15:45:11','2015-02-13 10:37:50','Getting_Started','admin admins','admin admins','','',0,'','<p><img style=\"float: left;  margin-right: 20px;\" src=\"{{media url=\"wysiwyg/blog_img/small_5.jpg\"}}\" alt=\"\" /></p>\r\n<p>First we need a local copy of the Headroom.js script which you can download from the plugin website or from the Github repo. I&rsquo;m using the minified version but they both contain the same exact code. </p>'),(5,'CSS Setup','<p><img style=\"float: left;  margin-right: 20px;\" src=\"{{media url=\"wysiwyg/blog_img/small_1.jpg\"}}\" alt=\"\" />This stage can get a little confusing but I hope to simplify as much as possible. The Headroom plugin requires a large amount of CSS, but unfortunately this isn&rsquo;t clarified on the plugin&rsquo;s homepage. My demo CSS file is split into different code sections and towards the bottom you&rsquo;ll find a whole bunch of animations and keyframes using CSS3 properties. In order to get your page working you should copy this CSS into your own stylesheet. Various classes pertain to different animations where the header bar will slide up out of view or slide down into view.</p>\r\n\r\n<p> My demo CSS file is split into different code sections and towards the bottom you&rsquo;ll find a whole bunch of animations and keyframes using CSS3 properties. In order to get your page working you should copy this CSS into your own stylesheet. Various classes pertain to different animations where the header bar will slide up out of view or slide down into view This stage can get a little confusing but I hope to simplify as much as possible. The Headroom plugin requires a large amount of CSS, but unfortunately this isn&rsquo;t clarified on the plugin&rsquo;s homepage. My demo CSS file is split into different code sections and towards the bottom you&rsquo;ll find a whole bunch of animations and keyframes using CSS3 properties. In order to get your page working you should copy this CSS into your own stylesheet. Various classes pertain to different animations where the header bar will slide up out of view or slide down into view.</p>',1,'2015-02-12 15:46:16',NULL,'CSS_Setup','admin admins','admin admins','','',0,'','<p><img style=\"float: left; margin-right: 20px;\" src=\"{{media url=\"wysiwyg/blog_img/small_1.jpg\"}}\" alt=\"\" />This stage can get a little confusing but I hope to simplify as much as possible. The Headroom plugin requires a large amount of CSS, but unfortunately this isn&rsquo;t clarified on the plugin&rsquo;s homepage.</p>');
